def minimum_cost_to_generate_chemical(N, M_a, M_b, chemicals):
    M = 1 << 30
    dp = [[M] * 420 for _ in range(420)]
    dp[0][0] = 1
    for (a, b, c) in chemicals:
        for i in range(400, -1, -1):
            for j in range(400, -1, -1):
                t = dp[i][j] + c
                if dp[i + a][j + b] > t:
                    dp[i + a][j + b] = t
    ans = M
    (_ma, _mb) = (M_a, M_b)
    while _ma < 410 > _mb:
        ans = min(ans, dp[_ma][_mb])
        _ma += M_a
        _mb += M_b
    return ans if ans < M else -1

